  return (
    <div>
      <input className="btn btn-primary" type="button" value="Click Me!" />
    </div>
  )
}

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <Foo />
  </React.StrictMode>
